import React, { useState } from 'react';
import axios from 'axios';
import Label from '../component/Label';
import Input from '../component/Finput'

const New = (porps) => {

    const [myname, setName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [password_confirmation, setPasswordConfirmation] = useState("");

    const handleInput = event => {
        // eslint-disable-next-line default-case
        switch (event.target.name){
          case 'myname':
            setName(event.target.value);
            break;
          case 'email':
            setEmail(event.target.value);
            break;
          case 'password':
            setPassword(event.target.password);
            break;
          case 'password_confirmation':
            setPasswordConfirmation(event.target.password_confirmation);
            break;
        }
    }

    const handleSubmit = (event) => {
        alert(myname);
    }

    return(
        <div className="container">
        <div className="row">
            <div className="col-12">
                <div className="card border-primary">
                    <div className="card-header"> Sign Up </div>
                    <div className="card-body text-left">
                        <form onSubmit={handleSubmit} >
                        <div className="form-group">
                            <Label htmlFor="exampleInputEmail1" value="Name:" />
                            <Input type="text" name="myname" value={myname} onChange={handleInput} />
                            <Label htmlFor="exampleInputEmail1" value="Email:" />
                            <Input type="email" name="email" value={email} onChange={handleInput} />
                            <Label htmlFor="exampleInputEmail1" value="Password:" />
                            <Input type="password" name="password" value={password} onChange={handleInput} />
                            <Label htmlFor="exampleInputEmail1" value="Password(again):" />
                            <Input type="password" name="password_confirmation" value={password_confirmation} onChange={handleInput} />
                        </div>
                        <button className="btn btn-primary" >Submit</button>
                        </form>
                    </div>
                </div>

            </div>

        </div>
    </div>
    )
}

export default New;
